import 'bootstrap/dist/css/bootstrap.min.css';
import './LeaderBoard.css';



const Tableheader = (props) => {
  const [sortedField, setSortedField] = React.useState(null);

  return(

    <thead>
        <tr id="colheaders" className="top100">
            <th className="idcol">#</th>

              <th className="sticky-column" onClick={() => setSortedField('Username')}>Username</th>
              <th className="sticky-column">Level</th>
              <th className="sticky-column">Score</th>
              <th className="sticky-column">Est Return BLOX</th>




        </tr>
    </thead>

  )

}

export default Tableheader;
